INSERT INTO `tx_sitepackage_domain_model_product` (`uid`, `pid`, `tstamp`, `crdate`, `deleted`, `title`, `description`, `image`, `price`, `categories`) VALUES
(1, 10, 1687259941, 1686146468, 0, 'Apple iPhone 14 Plus', '<p>The iPhone&nbsp;14 display has rounded corners that follow a beautiful curved design, and these corners are within a standard rectangle. When measured as a standard rectangular shape, the screen is 6.06&nbsp;inches diagonally (actual viewable area is less).</p>', '1', 1850.00, 1),
(2, 10, 1687184963, 1686146568, 0, 'Apple iPhone 12', '<p>Blast past fast. 5G speed. A14 Bionic, the fastest chip in a smartphone. An edge-to-edge OLED display. And Night mode on every camera.</p>', '1', 1100.00, 1),
(3, 10, 1687259928, 1686147294, 0, 'Apple iPhone 13', '<p>Your new superpower. A superbright display in a durable design. Hollywood-worthy video shooting made easy. A lightning-fast chip. And a big boost in battery life you’ll notice every day.</p>', '1', 2360.00, 1),
(4, 10, 1687259905, 1686645224, 0, 'Apple iPad Pro', '<p>Astonishing performance. Incredibly advanced displays. Superfast wireless connectivity. Next-level Apple&nbsp;Pencil capabilities. Powerful new features in iPadOS&nbsp;16. The ultimate iPad experience.</p>', '1', 1950.00, 1),
(5, 10, 1686666400, 1686649543, 0, 'Apple iPad Air', '<p>Supercharged by the Apple&nbsp;M1&nbsp;chip. 12MP Ultra&nbsp;Wide front camera with Centre&nbsp;Stage. Blazing-fast 5G. Works with Apple Pencil and Magic&nbsp;Keyboard.</p>', '1', 950.00, 0),
(6, 10, 1688457132, 1688457132, 0, 'Samsung Galaxy S23', '<p>A Triple Lens camera and a 6.1-inch Dynamic AMOLED screen mean you can take selfies and videos to the next level. Samsung Galaxy S23 colours - Green, Lavender, Cream and Phantom Black.</p>', '1', 700.00, 1),
(7, 10, 1688457547, 1688457414, 0, 'Samsung Galaxy Tab A7', '<p>Enjoy movies and games on a wide 8.7-inch display. Minimised bezels deliver a greater screen-to-body ratio without increasing the tablet size. The comfortably compact form factor helps keep your hands from getting tired, even when you\'ve been playing for hours.</p>', '1', 300.00, 1);

